//Footer
export { default as bannerFooter } from '../assets/images/logo-footer.png';

//Cambio Moedas
export { default as bannerMoeda } from '../assets/images/exchange.jpg';
export { default as bannerFundo } from '../assets/images/exchange.jpg';

//Crypto Icons
export { ReactComponent as Bitcoin } from '../assets/images/icons/bitcoin.svg';
export { ReactComponent as Binance } from '../assets/images/icons/binance.svg';
export { ReactComponent as Busd } from '../assets/images/icons/busd.svg';
export { ReactComponent as Dogecoin } from '../assets/images/icons/dogecoin.svg';
export { ReactComponent as Ethereum } from '../assets/images/icons/ethereum.svg';
export { ReactComponent as Eur } from '../assets/images/icons/eur.svg';
export { ReactComponent as GbtcToken } from '../assets/images/icons/gbtc-token.svg';
export { ReactComponent as Litecoin } from '../assets/images/icons/litecoin.svg';
export { ReactComponent as Polkadot } from '../assets/images/icons/polkadot.svg';
export { ReactComponent as Tron } from '../assets/images/icons/tron.svg';
export { ReactComponent as Usd } from '../assets/images/icons/usd.svg';
export { ReactComponent as Usdt } from '../assets/images/icons/usdt.svg';
export { ReactComponent as VeloxToken } from '../assets/images/icons/veloxcoin.svg';
export { ReactComponent as Xrp } from '../assets/images/icons/xrp.svg';
export { ReactComponent as Sol } from '../assets/images/icons/sol.svg';
export { ReactComponent as Ada } from '../assets/images/icons/ada.svg';
